package com.example.youssefiibrahim.gallereo.presenter;

import com.example.youssefiibrahim.gallereo.model.ImageStructure;
import com.example.youssefiibrahim.gallereo.model.ImageStructuresWrapper;
import com.example.youssefiibrahim.gallereo.model.PairWrapper;
import com.example.youssefiibrahim.gallereo.model.ResponseWrapper;

import org.junit.After;
import org.junit.Before;
import org.junit.Test;

import java.io.BufferedInputStream;
import java.io.BufferedOutputStream;
import java.io.BufferedReader;
import java.io.BufferedWriter;
import java.io.IOException;
import java.io.InputStream;
import java.io.InputStreamReader;
import java.io.OutputStream;
import java.io.OutputStreamWriter;
import java.net.HttpURLConnection;
import java.net.URL;

import static org.junit.Assert.*;

public class communicationTest {

    byte[] bts;

    boolean isconnected = false;
    @Before
    public void setUp() throws Exception {
        bts = new byte[10000];
    }

    @After
    public void tearDown() throws Exception {

    }

    @Test
    public void shouldProcessInput() throws IOException {
        String input = "Cat and DOG";
        PairWrapper pairWrapper = communication.processInput(input);
        assertEquals(2, pairWrapper.pairs.size());
        assertEquals(new Double(1), pairWrapper.pairs.get(0).weight);
    }

    @Test
    public void shouldRequestLabels() throws IOException {
        ImageStructuresWrapper wrapper = new ImageStructuresWrapper();
        ImageStructure imageStructure = new ImageStructure("1", "");
        wrapper.add(imageStructure);

        ResponseWrapper responseWrapper = communication.requestLabels(wrapper);
        assertTrue(responseWrapper != null);
        assertTrue(responseWrapper.responses.size() > 0);
    }
    @Test
    public void shouldSendHttpRequest() throws IOException, InterruptedException {

        ImageStructuresWrapper imageStructuresWrapper = new ImageStructuresWrapper();
        imageStructuresWrapper.add(new ImageStructure("1", ""));
        imageStructuresWrapper.add(new ImageStructure("2", ""));
        String jsonObject = Processing.toJson(imageStructuresWrapper);
        String response = communication.sendHttpRequest(jsonObject, communication.LABELER_URL, "application/json", bts).trim();
        assertTrue(response.length() > 0);
    }
}